observer.observe(document.documentElement, { childList: true, subtree: true });

const origInsertBefore = Node.prototype.insertBefore;
Node.prototype.insertBefore = function(newNode, referenceNode) {
    if(newNode instanceof HTMLIFrameElement){
        newNode.remove();
        return null;
    }
    return origInsertBefore.apply(this, [newNode, referenceNode]);
};

const origFetch = window.fetch;
window.fetch = async function(url, init){
    let res = await origFetch(url, init);
    let data;
    if(res.status === 204 || res.status === 205) return res;
    try{
        const text = await res.text();
        data = text ? JSON.parse(text) : {};
    }catch{ return res }

    try{ if(url.startsWith('https://edge.ads.twitch.tv/ads')) data = ''; }catch{}

    return new Response(JSON.stringify(data), {
        headers: res.headers,
        status: res.status,
        statusText: res.statusText,
    });
}
